<head>
  <meta charset="UTF-8">
  <title>CollectionView Perf Check</title>
</head>
<body>
<section class="layout">
  <p class="desc">CollectionView Perf Check</p>
  <button class="js-addlist js-newaddList">Use Optimized-V3 CV</button>
  <button class="js-addlist js-oldaddList">Use MN-V3 CV</button>
  <button class="js-clearList">Clear MN-V3 CV</button>
  <div class="listArea">
    <div>Collection Size: <span id="csize"></span></div>
    <div class="js-list"></div>
  </div>
</section>
<script src="../node_modules/underscore/underscore.js"></script>
<script src="../node_modules/jquery/dist/jquery.js"></script>
<script src="../node_modules/backbone/backbone.js"></script>
<script src="../lib/backbone.marionette.js"></script>
<script>
  window.OptimizedMarionetteCollectionView = Marionette.CollectionView;
</script>
<script src="https://cdnjs.cloudflare.com/ajax/libs/backbone.marionette/3.0.0-pre.4/backbone.marionette.js"></script>
<script>
  var data;
  var layout;
  var bigCollection;
  var itemTpl = _.template('<%= number %> <%= name %> <%= description %>');
  var extendObject = {
    ui:{
      itemView: '.js-item-view'
    },
    events:{
      'click @ui.itemView': 'onItemViewClick'
    },
    childView: Marionette.View.extend({
      className: 'js-item-view',
      template: itemTpl
    }),
    onItemViewClick: function (event){
      console.log(event);
    }
  };
  var MyCollectionView = Marionette.CollectionView.extend(extendObject);
  var MyOptimizedCollectionView = OptimizedMarionetteCollectionView.extend(extendObject);

  var MyLayout = Marionette.View.extend({
    el: '.listArea:first',
    template: false,
    ui: {
      csize: '#csize'
    },
    regions: {
      list: '.js-list'
    },
    onRender: function() {
      bigCollection = new Backbone.Collection(getData());
      this.ui.csize.text(bigCollection.length);
    },
    showList: function(useOptimized) {
      var RenderCollectionView = useOptimized ? MyOptimizedCollectionView : MyCollectionView;

      this.showChildView(
        'list',
        new RenderCollectionView({
          collection: bigCollection
        })
      );
    }
  });

  $('.js-addlist').bind('click', addList);

  var $clearButton = $('.js-clearList').bind('click', clearList);

  layout = new MyLayout();
  layout.render();

  var profilePrefix = 'Old:';

  function addList() {
    var useNewCV = $(this).is('.js-newaddList');
    var clearLabel = 'Clear MN-V3 CV';
    profilePrefix = 'Old:';

    if(useNewCV){
      profilePrefix = 'New:';
      clearLabel = 'Clear Optimized-V3 CV';
    }

    $clearButton.text(clearLabel);

    if (console && console.profile) {
      console.profile(profilePrefix + 'creating collectionView');
    }

    layout.showList(useNewCV);

    if (console && console.profileEnd) {
      console.profileEnd(profilePrefix + 'creating collectionView');
    }
  }

  function clearList() {
    if (layout) {
      if (console && console.profile) {
        console.profile(profilePrefix + 'destroying collectionView');
      }
      layout.getRegion('list').reset();
      if (console && console.profileEnd) {
        console.profileEnd(profilePrefix + 'destroying collectionView');
      }
    }
  }
